; Graphics library test
; Should eventually become a real library when library support is added in assembler

define GFX_PATTERN_TABLE_SIZE       = 1024      ; size of pattern table
define GFX_PALETTE_TABLE_SIZE       = 16        ; size of palette table
define GFX_TILES                    = 1938      ; number of tiles on screen

Main:

    savpc r15
    push r15
    jump GFXinitVram

    ; print some data to screen
    addr2reg PRINTDATA r1   ; data to copy
    load 27 r2              ; length of data
    load 350 r3             ; offset from start
    load 0 r4               ; palette indx

    savpc r15
    push r15
    jump GFXprintColored    
    
    halt


; Prints to screen, with color, data is accessed in bytes
; Reads each word from left to right
; INPUT:
;   r1 = address of data to print
;   r2 = length of data
;   r3 = position on screen
;   r4 = palette index
GFXprintColored:
    ; backup registers
    push r5
    push r6
    push r7
    push r8
    push r9
    push r10

    ; vram address
    load 0x0410 r10
    loadhi 0xC0 r10                 ; r10 = vram addr 1040 0xC00410

    ; loop variables
    load 0 r5                       ; r5 = loopvar
    or r10 r0 r6                    ; r6 = vram addr with offset
    or r1 r0 r7                     ; r7 = data addr with offset
    load 32 r8                      ; r8 = shift variable

    add r3 r6 r6                    ; apply offset from r3

    ; copy loop
    GFXprintColoredLoop:
        sub r8 8 r8             ; remove 8 from shift variable
        read 0 r7 r9            ; read 32 bits
        shiftr r9 r8 r9         ; shift to right
        write 0 r6 r9           ; write char to vram
        write 2040 r6 r4        ; write palette index to vram
        add r6 1 r6             ; incr vram address

        bne r0 r8 3             ; if we shifted the last byte
            add r7 1 r7             ; incr data address 
            load 32 r8              ; set shift variable back to 24

        add r5 1 r5             ; incr counter
        bge r5 r2 2             ; keep looping until all data is copied
        jump GFXprintColoredLoop

    ; restore registers
    pop r10
    pop r9
    pop r8
    pop r7
    pop r6
    pop r5

    ; return
    pop r15
    jumpr 3 r15


; Prints to screen, data is accessed in bytes
; Reads each word from left to right
; INPUT:
;   r1 = address of data to print
;   r2 = length of data
;   r3 = position on screen
GFXprint:
    ; backup registers
    push r4
    push r5
    push r6
    push r7
    push r8
    push r9

    ; vram address
    load 0x0410 r4
    loadhi 0xC0 r4                  ; r4 = vram addr 1040 0xC00410

    ; loop variables
    load 0 r5                       ; r5 = loopvar
    or r4 r0 r6                     ; r6 = vram addr with offset
    or r1 r0 r7                     ; r7 = data addr with offset
    load 32 r8                      ; r8 = shift variable

    add r3 r6 r6                    ; apply offset from r3

    ; copy loop
    GFXprintLoop:
        sub r8 8 r8             ; remove 8 from shift variable
        read 0 r7 r9            ; read 32 bits
        shiftr r9 r8 r9         ; shift to right
        write 0 r6 r9           ; write char to vram
        add r6 1 r6             ; incr vram address

        bne r0 r8 3             ; if we shifted the last byte
            add r7 1 r7             ; incr data address 
            load 32 r8              ; set shift variable back to 24

        add r5 1 r5             ; incr counter
        bge r5 r2 2             ; keep looping until all data is copied
        jump GFXprintLoop

    ; restore registers
    pop r9
    pop r8
    pop r7
    pop r6
    pop r5
    pop r4

    ; return
    pop r15
    jumpr 3 r15
   

; Initialize VRAM by copying pattern table and palette table
; also clears BG tile and BG palette table
GFXinitVram:
    ; ascii address
    addr2reg ASCIITABLE r1 

    savpc r15
    push r15
    jump GFXcopyPatternTable

    ; palette address
    addr2reg PALETTETABLE r1 

    savpc r15
    push r15
    jump GFXcopyPaletteTable

    savpc r15
    push r15
    jump GFXclearBGtileTable

    savpc r15
    push r15
    jump GFXclearBGpaletteTable

    ; return
    pop r15
    jumpr 3 r15
  

; Loads entire pattern table
; INPUT:
;   r1 = address of pattern table to copy
GFXcopyPatternTable:
    ; backup registers
    push r2
    push r3
    push r4
    push r5
    push r6

    ; vram address
    load 0x0000 r2
    loadhi 0xC0 r2                  ; r2 = vram addr 0 0xC00000

    ; loop variables
    load 0 r3                       ; r3 = loopvar
    load GFX_PATTERN_TABLE_SIZE r4  ; r4 = loopmax
    or r2 r0 r5                     ; r5 = vram addr with offset
    or r1 r0 r6                     ; r6 = ascii addr with offset

    ; copy loop
    GFXinitPatternTableLoop:
        copy 0 r6 r5            ; copy ascii to vram
        add r5 1 r5             ; incr vram address
        add r6 1 r6             ; incr ascii address 
        add r3 1 r3             ; incr counter
        beq r3 r4 2             ; keep looping until all data is copied
        jump GFXinitPatternTableLoop

    ; restore registers
    pop r6
    pop r5
    pop r4
    pop r3
    pop r2

    ; return
    pop r15
    jumpr 3 r15


; Loads entire palette table
; INPUT:
;   r1 = address of palette table to copy
GFXcopyPaletteTable:
    ; backup registers
    push r2
    push r3
    push r4
    push r5
    push r6

    ; vram address
    load 0x0400 r2
    loadhi 0xC0 r2                  ; r2 = vram addr 1024 0xC00400

    ; loop variables
    load 0 r3                       ; r3 = loopvar
    load GFX_PALETTE_TABLE_SIZE r4  ; r4 = loopmax
    or r2 r0 r5                     ; r5 = vram addr with offset
    or r1 r0 r6                     ; r6 = palette addr with offset

    ; copy loop
    GFXinitPaletteTableLoop:
        copy 0 r6 r5            ; copy palette to vram
        add r5 1 r5             ; incr vram address
        add r6 1 r6             ; incr palette address 
        add r3 1 r3             ; incr counter
        beq r3 r4 2             ; keep looping until all data is copied
        jump GFXinitPaletteTableLoop

    ; restore registers
    pop r6
    pop r5
    pop r4
    pop r3
    pop r2

    ; return
    pop r15
    jumpr 3 r15


; Clear BG tile table
GFXclearBGtileTable:
    ; backup registers
    push r1
    push r2
    push r3
    push r4
    push r5

    ; vram address
    load 0x0410 r1
    loadhi 0xC0 r1          ; r1 = vram addr 1040 0xC00410

    ; loop variables
    load 0 r3               ; r3 = loopvar
    load GFX_TILES r4       ; r4 = loopmax
    or r1 r0 r5             ; r5 = vram addr with offset

    ; copy loop
    GFXclearBGtileTableLoop:
        write 0 r5 r0           ; clear tile
        add r5 1 r5             ; incr vram address
        add r3 1 r3             ; incr counter
        beq r3 r4 2             ; keep looping until all tiles are cleared
        jump GFXclearBGtileTableLoop

    ; restore registers
    pop r5
    pop r4
    pop r3
    pop r2
    pop r1

    ; return
    pop r15
    jumpr 3 r15
  

; Clear BG palette table
GFXclearBGpaletteTable:
    ; backup registers
    push r1
    push r2
    push r3
    push r4
    push r5

    ; vram address
    load 0x0C08 r1
    loadhi 0xC0 r1          ; r1 = vram addr 1040+2040 0xC00C08

    ; loop variables
    load 0 r3               ; r3 = loopvar
    load GFX_TILES r4       ; r4 = loopmax
    or r1 r0 r5             ; r5 = vram addr with offset

    ; copy loop
    GFXclearBGpaletteTableLoop:
        write 0 r5 r0           ; clear tile
        add r5 1 r5             ; incr vram address
        add r3 1 r3             ; incr counter
        beq r3 r4 2             ; keep looping until all tiles are cleared
        jump GFXclearBGpaletteTableLoop

    ; restore registers
    pop r5
    pop r4
    pop r3
    pop r2
    pop r1

    ; return
    pop r15
    jumpr 3 r15

